import {
  StyleSheet,
  Text,
  View,
  SafeAreaView,
  ScrollView,
  TouchableOpacity,
  Image,
  Modal,
  TextInput,
  Dimensions,
   DrawerLayoutAndroid,
  FlatList,
  Animated, PanResponder,
  StatusBar,
} from "react-native";
import React, { useRef, useState } from "react";
import { Colors, Default, Fonts } from "../constants/styles";
import Ionicons from "react-native-vector-icons/Ionicons";
import MaterialIcons from "react-native-vector-icons/MaterialIcons";

import SimpleLineIcons from "react-native-vector-icons/SimpleLineIcons";
import { useTranslation } from "react-i18next";
import Stars from "react-native-stars";

  import Swiper from "react-native-swiper";

const { width, height } = Dimensions.get("window");



const HomeScreen = ({ navigation }) => {

  
  const [cancelModal, setCancelModal] = useState(false);
    
  const [isSidePanelOpen, setIsSidePanelOpen] = useState(false);
  const toggleSidePanel = () => {
    setIsSidePanelOpen(!isSidePanelOpen);
  };
  

  const { t, i18n } = useTranslation();

  const isRtl = i18n.dir() == "rtl";

  function tr(key) {
    return t(`homeScreen:${key}`);
  }


  return (

    <SafeAreaView
      style={{
       flex: 1,
        backgroundColor: Colors.extraLightGrey,
        paddingTop: StatusBar.currentHeight,
      }}
    >
      <View
        style={{
          backgroundColor: Colors.primary,
          paddingVertical: Default.fixPadding * 1.2,
          paddingTop: Default.fixPadding,
      //    marginBottom:56
        }}
      >
        <View
          style={{
            flexDirection: isRtl ? "row-reverse" : "row",
            marginBottom: Default.fixPadding * 1.5,
            alignItems: "center",
          }}
        >
          <View
            style={{
              flexDirection: isRtl ? "row-reverse" : "row",
              alignItems: "center",
        
            //  paddingHorizontal: Default.fixPadding * 2,
            }}
          >
            
          

          <TouchableOpacity
            style={{
              flex: 1,
              paddingHorizontal: Default.fixPadding * 4.5,
              flexDirection: isRtl ? "row-reverse" : "row",
            }}
            onPress={() => navigation.navigate("AdminMain")}
          >
            <SimpleLineIcons
              name="location-pin"
              size={22}
              color={Colors.white}
            />
             <Text
              style={{
                ...Fonts.Medium14white,
                paddingTop:3
              }}
            >
             
             2464 Royal Ln. Mesa, New Jersey 45463
            </Text>
          </TouchableOpacity>
        </View>
       
</View>
<View    style={{
              
              flexDirection: isRtl ? "row-reverse" : "row",
              }}>
<TouchableOpacity onPress={toggleSidePanel}>
  <Ionicons name="md-menu"size={38} color="white" />
</TouchableOpacity>
        <TouchableOpacity
          style={{
            ...Default.shadow,
            backgroundColor: Colors.white,
            flexDirection: isRtl ? "row-reverse" : "row",
            borderRadius: 5,
            padding: Default.fixPadding * 0.8,
            marginHorizontal: Default.fixPadding * 0.2,
            width:320,
            marginRight:6
          }}
        >
          <Ionicons name="search" size={20} color={Colors.grey} />
          <TextInput
        style={{
          // Add your custom styles here
          flex: 1,
          marginLeft: Default.fixPadding * 0.6,
          ...Fonts.SemiBold16grey,
        }}
        placeholder={tr('search')}
        placeholderTextColor={Colors.grey}
      //  value={searchText}
    //    onChangeText={setSearchText}
      />
        </TouchableOpacity>
        <TouchableOpacity     onPress={() =>
              navigation.navigate("Messages", {
                title: "Electrician",
              })
            }>
  <Ionicons name="chatbubbles-outline" size={38} color="white" />
</TouchableOpacity>
        </View>
      </View>
      <ScrollView showsVerticalScrollIndicator={false}>
       

    
        <View
          style={{
            flexDirection: isRtl ? "row-reverse" : "row",
            justifyContent: "space-between",
            marginLeft: Default.fixPadding * 3,
            
            marginBottom: Default.fixPadding * 3,
            marginTop: Default.fixPadding * 3,
          }}
        >
          <TouchableOpacity
            onPress={() =>
              navigation.navigate("lostTabt", {
                title: "Electrician",
              })
            }
            style={{
              ...Default.shadow,
              backgroundColor: Colors.white,
              borderRadius: 10,
              justifyContent: "center",
              alignItems: "center",
              paddingVertical: Default.fixPadding * 2,
              width: width /2.5,
              
            }}
          >
            <Image
              source={require("../assets/images/losn.png")}
              style={{ height: 65, width: 65 }}
            />
            <Text
              numberOfLines={1}
              style={{
               
                ...Fonts.SemiBold15primary,
                overflow: "hidden",
                marginTop: Default.fixPadding * 0.8,
              }}
            >
              Lost&Found
            </Text>
          </TouchableOpacity>
          <TouchableOpacity
            onPress={() =>
              navigation.navigate("Sus", {
                title: "Carpenter",
              })
            }
            style={{
              ...Default.shadow,
              backgroundColor: Colors.white,
              borderRadius: 10,
              justifyContent: "center",
              alignItems: "center",
              paddingVertical: Default.fixPadding * 3,
              width: width /2.5,
              marginRight:23
            }}
          >
            <Image
              source={require("../assets/images/jj.png")}
              style={{ height: 65, width: 65 }}
            />
            <Text
              numberOfLines={1}
              style={{
                ...Fonts.SemiBold15primary,
                overflow: "hidden",
                marginTop: Default.fixPadding * 0.8,
              }}
            >
             Neighbor Watch
            </Text>
          </TouchableOpacity>
         
        </View>
        <View
          style={{ 
             flexDirection: isRtl ? "row-reverse" : "row",
          justifyContent: "space-between",
          marginLeft: Default.fixPadding * 3,
          
          marginBottom: Default.fixPadding * 2,
          marginTop: 20,
          }}
        >
          <TouchableOpacity
            onPress={() =>
              navigation.navigate("SkillSharing", {
                title: "Skill Sharing",
              })
            }
            style={{
              ...Default.shadow,
              backgroundColor: Colors.white,
              borderRadius: 10,
              justifyContent: "center",
              alignItems: "center",
              paddingVertical: Default.fixPadding * 2,
              width: width /2.5,
            }}
          >
            <Image
              source={require("../assets/images/toi.png")}
              style={{ height: 72, width: 125 }}
            />
            <Text
             numberOfLines={1}
             style={{
               ...Fonts.SemiBold15primary,
               overflow: "hidden",
               marginTop: Default.fixPadding * 0.8,
              }}
            >
             Skills Hub
            </Text>
          </TouchableOpacity>
          <TouchableOpacity
            onPress={() =>
              navigation.navigate("BuySell", {
                title: "Buy&Sell",
              })
            }
            style={{
              ...Default.shadow,
              backgroundColor: Colors.white,
              borderRadius: 10,
              justifyContent: "center",
              alignItems: "center",
              paddingVertical: Default.fixPadding * 3,
              width: width /2.5,
              marginRight:23
            }}
          >
            <Image
              source={require("../assets/images/u.png")}
              style={{ height: 70, width: 95 }}
            />
            
            <Text
              numberOfLines={1}
              style={{
         ...Fonts.SemiBold15primary,
               overflow: "hidden",
               marginTop: Default.fixPadding * 0.8,
              }}
            >
             Sell Zone
            </Text>
          </TouchableOpacity>
      
        </View>
        <View
          style={{ 
